create database Retail;
use Retail;

create table admin(
admin_name varchar(50),
admin_id int primary key,
admin_email varchar(50) not null unique,
admin_password varchar(50) not null
);

create table customer(
customer_id int primary key not null,
customer_name varchar(50),
mobile_no varchar(15) not null unique,
email varchar(50) not null unique,
customer_password varchar(20) not null,
address varchar(100) not null,
city varchar(50),
state varchar(50),
pincode varchar(50) ,
membership varchar(50) ,
wallet int 
);

create table seller(
seller_id int primary key,
seller_name varchar(50),
seller_address varchar(100)
);

create table product(
product_id int primary key,
product_name varchar(50),
category varchar(50),
normal_price int,
elite_price int,
prime_price int,
descrption text,
stock int,
seller_id int,
foreign key (seller_id) references seller(seller_id)
);

    
    
create table delievery_boy(
	d_id int unique primary key,
    d_name varchar(20) not null,
    d_rating float,
    d_mobile_number varchar(20)
    );
    
create table cart(
	cart_id int primary key not null,
    order_date date not null,
    total_price int not null,
    customer_id int not null,
    d_id int not null,
    foreign key (customer_id) references customer(customer_id),
    foreign key (d_id) references delievery_boy(d_id)
    );
    
create table cart_item(
	item_id int primary key,
    cart_id int not null,
    product_id int,
    quantity int not null,
    foreign key(cart_id) references cart(cart_id),
    foreign key(product_id) references product(product_id)
    );
		









